import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

import { BrowserRouter } from 'react-router-dom';

ReactDOM.render(
  <BrowserRouter>
    <App /></BrowserRouter>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
